  #bg::after {
    content: '';
    position: absolute;
    inset: 0;
    background: linear-gradient(
      to bottom,
      rgba(0,0,0,0.30) 0%,
      rgba(0,0,0,0.12) 40%,
      rgba(0,0,0,0.50) 100%
    );
  }

  /* ── LAYOUT ── */
  #app {
    position: relative;
    z-index: 1;
    width: 100%; height: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    gap: 0;
  }

  /* ── CLOCK ── */
  #clock {
    font-size: 96px;
    font-weight: 100;
    letter-spacing: -3px;
    color: var(--text-primary);
    text-shadow: 0 0 80px rgba(255,255,255,0.08), 0 2px 20px rgba(0,0,0,0.7);
    line-height: 1;
    opacity: 0;
    transform: translateY(12px);
    animation: fadeUp 0.8s 0.1s cubic-bezier(0.4,0,0.2,1) forwards;
    user-select: none;
  }

  /* ── DATE ── */
  #date {
    font-size: 11px;
    font-weight: 300;
    letter-spacing: 5px;
    text-transform: uppercase;
    color: var(--text-muted);
    margin-top: 8px;
    opacity: 0;
    transform: translateY(8px);
    animation: fadeUp 0.8s 0.25s cubic-bezier(0.4,0,0.2,1) forwards;
    user-select: none;
  }

  /* ── SEARCH ── */
  #search-wrap {
    margin-top: 36px;
    width: 560px;
    opacity: 0;
    transform: translateY(8px);
    animation: fadeUp 0.8s 0.4s cubic-bezier(0.4,0,0.2,1) forwards;
  }

  #search-form {
    position: relative;
    width: 100%;
  }

  #search-input {
    width: 100%;
    padding: 14px 26px;
    border-radius: 12px;
    border: 1px solid var(--glass-border);
    outline: none;
    background: var(--glass-bg);
    backdrop-filter: var(--glass-blur);
    -webkit-backdrop-filter: var(--glass-blur);
    box-shadow: var(--glass-shine), 0 8px 32px rgba(0,0,0,0.35);
    color: var(--text-primary);
    font-family: 'Outfit', sans-serif;
    font-size: 13px;
    font-weight: 300;
    letter-spacing: 2.5px;
    text-transform: uppercase;
    transition: all 0.3s cubic-bezier(0.4,0,0.2,1);
  }

  #search-input::placeholder {
    color: rgba(255,255,255,0.20);
    letter-spacing: 3px;
  }

  #search-input:focus {
    background: rgba(255,255,255,0.085);
    border-color: rgba(255,255,255,0.38);
    box-shadow:
      var(--glass-shine),
      0 0 0 3px rgba(255,255,255,0.055),
      0 0 24px rgba(255,255,255,0.07),
      0 12px 40px rgba(0,0,0,0.4);
  }

  /* ── TILES ── */
  #tiles {
    margin-top: 20px;
    display: grid;
    grid-template-columns: repeat(3, var(--tile-size));
    grid-template-rows: repeat(2, var(--tile-size));
    gap: 14px;
    width: 560px;
  }

  .tile {
    display: flex;
    align-items: center;
    justify-content: center;
    width: var(--tile-size);
    height: var(--tile-size);
    border-radius: 20px;
    border: 1px solid var(--glass-border);
    background: var(--glass-bg);
    backdrop-filter: var(--glass-blur);
    -webkit-backdrop-filter: var(--glass-blur);
    box-shadow: var(--glass-shine), 0 6px 28px rgba(0,0,0,0.25);
    text-decoration: none;
    color: rgba(255,255,255,0.65);
    font-size: 11px;
    font-weight: 400;
    letter-spacing: 1.8px;
    text-align: center;
    position: relative;
    overflow: hidden;
    cursor: pointer;
    transition: all 0.25s cubic-bezier(0.4,0,0.2,1);
    opacity: 0;
    transform: translateY(10px);
  }

  /* Staggered tile entrance */
  .tile:nth-child(1) { animation: fadeUp 0.7s 0.55s cubic-bezier(0.4,0,0.2,1) forwards; }
  .tile:nth-child(2) { animation: fadeUp 0.7s 0.62s cubic-bezier(0.4,0,0.2,1) forwards; }
  .tile:nth-child(3) { animation: fadeUp 0.7s 0.69s cubic-bezier(0.4,0,0.2,1) forwards; }
  .tile:nth-child(4) { animation: fadeUp 0.7s 0.76s cubic-bezier(0.4,0,0.2,1) forwards; }
  .tile:nth-child(5) { animation: fadeUp 0.7s 0.83s cubic-bezier(0.4,0,0.2,1) forwards; }
  .tile:nth-child(6) { animation: fadeUp 0.7s 0.90s cubic-bezier(0.4,0,0.2,1) forwards; }

  /* Top shine line */
  .tile::before {
    content: '';
    position: absolute;
    top: 0; left: 12%; width: 76%; height: 1px;
    background: linear-gradient(90deg, transparent, rgba(255,255,255,0.28), transparent);
    pointer-events: none;
  }

  /* Bottom subtle gradient */
  .tile::after {
    content: '';
    position: absolute;
    bottom: 0; left: 0; right: 0; height: 40%;
    background: linear-gradient(to top, rgba(0,0,0,0.12), transparent);
    pointer-events: none;
    border-radius: 0 0 20px 20px;
  }

  .tile:hover {
    background: rgba(255,255,255,0.075);
    border-color: rgba(255,255,255,0.32);
    color: rgba(255,255,255,0.95);
    transform: translateY(-2px);
    box-shadow:
      var(--glass-shine),
      var(--glow-hover),
      0 14px 44px rgba(0,0,0,0.38);
  }

  .tile:active {
    transform: translateY(-1px) scale(0.98);
  }

  .tile-inner {
    position: relative;
    z-index: 1;
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 12px;
  }

  .tile-icon {
    width: 28px;
    height: 28px;
    opacity: 0.55;
    transition: opacity 0.3s cubic-bezier(0.4,0,0.2,1),
                filter  0.3s cubic-bezier(0.4,0,0.2,1),
                color   0.3s cubic-bezier(0.4,0,0.2,1);
  }

  .tile:hover .tile-icon {
    opacity: 1;
    filter: drop-shadow(0 0 10px var(--brand-glow));
  }

  /* Apple-like active/click state */
  .tile:active {
    transform: scale(0.95) !important;
    background: rgba(255,255,255,0.08) !important;
    border-color: rgba(255,255,255,0.35) !important;
    transition: transform 0.08s cubic-bezier(0.4,0,0.2,1),
                background 0.08s ease,
                border-color 0.08s ease !important;
  }

  .tile:active .tile-icon {
    opacity: 0.75;
    transform: scale(0.94);
  }

  .tile:active .tile-label {
    opacity: 0.6;
  }

  /* Brand icon farben */
  .tile-claude  svg { fill: #d4956a; }
  .tile-chatgpt svg { fill: #74d7a0; }
  .tile-youtube svg { fill: #ff4e4e; }
  .tile-yahoo   svg { fill: #a069f0; }
  .tile-github  svg { fill: #e0e0e0; }
  .tile-vercel  svg { fill: #ffffff; }

  /* Sanfter Ambient Glow beim Hover */
  .tile-claude  { --brand-glow: rgba(212,149,106,0.25); }
  .tile-chatgpt { --brand-glow: rgba(116,215,160,0.22); }
  .tile-youtube { --brand-glow: rgba(255,78,78,0.22); }
  .tile-yahoo   { --brand-glow: rgba(160,105,240,0.22); }
  .tile-github  { --brand-glow: rgba(220,220,220,0.18); }
  .tile-vercel  { --brand-glow: rgba(255,255,255,0.18); }

  .tile-label {
    position: relative;
    z-index: 1;
    line-height: 1.5;
  }

  /* ── BACKGROUND UPLOAD HINT ── */
  #bg-hint {
    position: fixed;
    bottom: 24px;
    right: 28px;
    font-size: 10px;
    letter-spacing: 2px;
    text-transform: uppercase;
    color: rgba(255,255,255,0.18);
    cursor: pointer;
    transition: color 0.2s;
    user-select: none;
  }
  #bg-hint:hover { color: rgba(255,255,255,0.45); }
  #bg-file { display: none; }

  /* ── ANIMATIONS ── */
  @keyframes fadeUp {
    to { opacity: 1; transform: translateY(0); }
  }
</style>
</head>

<!-- Hintergrundbild Upload -->
<div id="bg-hint" onclick="document.getElementById('bg-file').click()">⬡ Hintergrundbild</div>
<input type="file" id="bg-file" accept="image/*">

<script>
  // ── CLOCK ──
  function updateClock() {
    const now = new Date();
    const h = String(now.getHours()).padStart(2,'0');
    const m = String(now.getMinutes()).padStart(2,'0');
    document.getElementById('clock').textContent = h + ':' + m;

    const days = ['Sonntag','Montag','Dienstag','Mittwoch','Donnerstag','Freitag','Samstag'];
    const months = ['Januar','Februar','März','April','Mai','Juni','Juli','August','September','Oktober','November','Dezember'];
    const d = now;
    document.getElementById('date').textContent =
      days[d.getDay()] + ', ' + d.getDate() + '. ' + months[d.getMonth()];
  }
  updateClock();
  setInterval(updateClock, 1000);

  // ── BACKGROUND IMAGE ──
  // Gespeichertes Bild laden
  const savedBg = localStorage.getItem('bg_image');
  if (savedBg) {
    document.getElementById('bg').style.backgroundImage = 'url(' + savedBg + ')';
  }

  // Neues Bild hochladen
  document.getElementById('bg-file').addEventListener('change', function(e) {
    const file = e.target.files[0];
    if (!file) return;
    const reader = new FileReader();
    reader.onload = function(ev) {
      const dataUrl = ev.target.result;
      document.getElementById('bg').style.backgroundImage = 'url(' + dataUrl + ')';
      try { localStorage.setItem('bg_image', dataUrl); } catch(err) {}
    };
    reader.readAsDataURL(file);
  });

  // ── SEARCH: Enter submit ──
  document.getElementById('search-input').addEventListener('keydown', function(e) {
    if (e.key === 'Enter') {
      document.getElementById('search-form').submit();
    }
  });
</script>

</body>
